import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faInstagram } from '@fortawesome/free-brands-svg-icons';

function Contact () {
  return (
    <section id="contact" style={{ textAlign: 'center' }}>
      <h2>Title Text Here</h2>
      <p>Body text here. You can put any information regarding contacting the Japanese Student Association here.</p>
      <a href="https://www.instagram.com/jsa_oberlin/" target="_blank" rel="noopener noreferrer">
        <FontAwesomeIcon icon={faInstagram} size="2x" />
      </a>
    </section>
  );
}

export default Contact ;
